@-moz-document url-prefix("http://"), url-prefix("https://") {
/* Set the background image */
    body {
        background: url('https://www.desktopbackground.org/download/1920x1080/2014/01/30/714439_call-of-duty-modern-warfare-2-wallpapers-hd-free-download_1920x1080_h.jpg') no-repeat center center fixed;
        background-size: cover;
        margin: 0;
        padding: 0;
    }

    /* Add the text at the bottom of the page */
    body::after {
        content: "Made by A1M on deadshot.io";
        display: block;
        position: fixed;
        bottom: 10px;
        width: 100%;
        text-align: center;
        font-size: 16px;
        color: white;
        text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.8);
    }
}
